import { HashRouter as Router, Route, Redirect } from 'react-router-dom';
import { fetchTableListdata } from '../../actions/product-list.action';

class ProductListPage extends Component {
    constructor(props) {
        super(props);
    }
    componentDidMount() {
        this.props.fetchTableListdata();
    }

    render() {
        const keys = ['Name', 'gravity', 'population', 'terrain', 'diameter']
        return (

            <Grid container spacing={8}>
                <Grid item xs={12}>
                    <Grid container>
                        <Grid item xs={12}>
                            <Table className={classes.tableRoot}>
                                <TableHead>
                                    <TableRow>
                                        {keys.map(row => <TableCell className={classes.tableRoot} key={row.displayTitle}>{row.displayTitle}</TableCell>)}
                                    </TableRow>
                                </TableHead>
                                <TableBody>

                                    {/* <TableRow>
                                        {keys.map(row =>
                                            <TableCell className={classes.tableRoot} key={row.displayTitle} align="left">{monthlyChargesForChildNumber.ROW[row.key]}</TableCell>)}
                                    </TableRow> */}

                                </TableBody>
                            </Table>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>

        )
    }
}
const mapDispatchToProps = dispatch => ({

    fetchTableListdata: () => dispatch(fetchTableListdata()),
});
const mapStateToProps = state => {
    console.log("data", state.productListInfo.productListApiResponse)
    return {
        productListApiResponse: state.productListInfo.productListApiResponse
    };
}

export default withRouter(connect(
    mapStateToProps, mapDispatchToProps
)(ProductListPage));
